(1, 'about', '<p><strong>about us&nbsp;</strong></p>\r\n<p>kkkkkk</p>'),
(2, 'terms', 'What is Lorem Ipsum?\r\nLorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.'),
(3, 'privacy', '<p class=\"MsoNormal\">This Privacy Policy (&ldquo;Policy&rdquo;) describes the policies and procedures on the collection, use, disclosure and protection of your information when you use our website located at WahMeal.in, or the Wah Meal mobile application (collectively, &ldquo;Wah Meal Platform&rdquo;) (&ldquo;Wah Meal&rdquo;, &ldquo;Company&rdquo;, &ldquo;we&rdquo;, &ldquo;us&rdquo; and &ldquo;our&rdquo;),<span style=\"mso-spacerun: yes;\">&nbsp; </span>a private company established under the laws of India having its registered office at Bhubaneswar</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">The terms &ldquo;you&rdquo; and &ldquo;your&rdquo; refer to the user of the Wah Meal Platform. The term &ldquo;Services&rdquo; refers to any services offered by Wah Meal whether on the Wah Meal Platform or otherwise.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">Please read this Policy before using the Wah Meal Platform or submitting any personal information to Wah Meal. This Policy is a part of and incorporated within, and is to be read along with, the Terms of Use.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">YOUR CONSENT</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">By using the Wah Meal Platform and the Services, you agree and consent to the collection, transfer, use, storage, disclosure and sharing of your information as described and collected by us in accordance with this Policy.<span style=\"mso-spacerun: yes;\">&nbsp; </span>If you do not agree with the Policy, please do not use or access the Wah Meal Platform.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">POLICY CHANGES</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">We may occasionally update this Policy and such changes will be posted on this page. If we make any significant changes to this Policy we will endeavour to provide you with reasonable notice of such changes, such as via prominent notice on the Wah Meal Platform or to your email address on record and where required by applicable law, we will obtain your consent. To the extent permitted under the applicable law, your continued use of our Services after we publish or send a notice about our changes to this Policy shall constitute your consent to the updated Policy.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">LINKS TO OTHER WEBSITES</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">The Wah Meal Platform may contain links to other websites. Any personal information about you collected whilst visiting such websites is not governed by this Policy. Wah Meal shall not be responsible for and has no control over the practices and content of any website accessed using the links contained on the Wah Meal Platform. This Policy shall not apply to any information you may disclose to any of our service providers/service personnel which we do not require you to disclose to us or any of our service providers under this Policy.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">INFORMATION WE COLLECT FROM YOU</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">Device Information: In order to improve your app experience and lend stability to our services to you, we may collect information or employ third party plugins that collect information about the devices you use to access our Services, including the hardware models, operating systems and versions, software, file names and versions, preferred languages, unique device identifiers, advertising identifiers, serial numbers, device motion information, mobile network information, installed applications on device and phone state. The information collected thus will be disclosed to or collected directly by these plugins and may be used to improve the content and/or functionality of the services offered to you. Analytics companies may use mobile device IDs to track your usage of the Wah Meal Platform;</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">COOKIES</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">Our Wah Meal Platform and third parties with whom we partner, may use cookies, pixel tags, web beacons, mobile device IDs, &ldquo;flash cookies&rdquo; and similar files or technologies to collect and store information with respect to your use of the Services and third-party websites.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">Cookies are small files that are stored on your browser or device by websites, apps, online media and advertisements. We use cookies and similar technologies for purposes such as:</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">Authenticating users;</p>\r\n<p class=\"MsoNormal\">Remembering user preferences and settings;</p>\r\n<p class=\"MsoNormal\">Determining the popularity of content;</p>\r\n<p class=\"MsoNormal\">Delivering and measuring the effectiveness of advertising campaigns;</p>\r\n<p class=\"MsoNormal\">Analysing site traffic and trends, and generally understanding the online behaviours and interests of people who interact with our services.</p>\r\n<p class=\"MsoNormal\">A pixel tag (also called a web beacon or clear GIF) is a tiny graphic with a unique identifier, embedded invisibly on a webpage (or an online ad or email), and is used to count or track things like activity on a webpage or ad impressions or clicks, as well as to access cookies stored on users&rsquo; computers. We use pixel tags to measure the popularity of our various pages, features and services. We also may include web beacons in e-mail messages or newsletters to determine whether the message has been opened and for other analytics.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">To modify your cookie settings, please visit your browser&rsquo;s settings. By using our Services with your browser settings to accept cookies, you are consenting to our use of cookies in the manner described in this section.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">We may also allow third parties to provide audience measurement and analytics services for us, to serve advertisements on our behalf across the Internet, and to track and report on the performance of those advertisements. These entities may use cookies, web beacons, SDKs and other technologies to identify your device when you visit the Wah Meal Platform and use our Services, as well as when you visit other online sites and services.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">Please see our Cookie Policy for more information regarding the use of cookies and other technologies described in this section, including regarding your choices relating to such technologies.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">USES OF YOUR INFORMATION</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">We use the information we collect for following purposes, including:</p>\r\n<p class=\"MsoNormal\">To provide, personalise, maintain and improve our products and services, such as to enable deliveries and other services, enable features to personalise your Wah Meal account;</p>\r\n<p class=\"MsoNormal\">To carry out our obligations arising from any contracts entered into between you and us and to provide you with the relevant information and services;</p>\r\n<p class=\"MsoNormal\">To administer and enhance the security of our Wah Meal Platform and for internal operations, including troubleshooting, data analysis, testing, research, statistical and survey purposes;</p>\r\n<p class=\"MsoNormal\">To provide you with information about services we consider similar to those that you are already using, or have enquired about, or may interest you. If you are a registered user, we will contact you by electronic means (e-mail or SMS or telephone or other internet based instant messaging systems) with information about these services;</p>\r\n<p class=\"MsoNormal\">To understand our users (what they do on our Services, what features they like, how they use them, etc.), improve the content and features of our Services (such as by personalizing content to your interests), process and complete your transactions, make special offers, provide customer support, process and respond to your queries;</p>\r\n<p class=\"MsoNormal\">To generate and review reports and data about, and to conduct research on, our user base and Service usage patterns;</p>\r\n<p class=\"MsoNormal\">To allow you to participate in interactive features of our Services, if any; or</p>\r\n<p class=\"MsoNormal\">To measure or understand the effectiveness of advertising we serve to you and others, and to deliver relevant advertising to you.</p>\r\n<p class=\"MsoNormal\">If you are a partner restaurant or merchant or delivery partner, to track the progress of delivery or status of the order placed by our customers.</p>\r\n<p class=\"MsoNormal\">to carry out academic research with academic partners.</p>\r\n<p class=\"MsoNormal\">We may combine the information that we receive from third parties with the information you give to us and information we collect about you for the purposes set out above.<span style=\"mso-spacerun: yes;\">&nbsp; </span>Further, we may anonymize and/or de-identify information collected from you through the Services or via other means, including via the use of third-party web analytic tools. As a result, our use and disclosure of aggregated and/or de-identified information is not restricted by this Policy, and it may be used and disclosed to others without limitation.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">We analyse the log files of our Wah Meal Platform that may contain Internet Protocol (IP) addresses, browser type and language, Internet service provider (ISP), referring, app crashes, page viewed and exit websites and applications, operating system, date/time stamp, and clickstream data. This helps us to administer the website, to learn about user behavior on the site, to improve our product and services, and to gather demographic information about our user base as a whole.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">DISCLOSURE AND DISTRIBUTION OF YOUR INFORMATION</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">We may share your information that we collect for following purposes:</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">With Service Providers: We may share your information with our vendors, consultants, marketing partners, research firms and other service providers or business partners, such as Payment processing companies, to support our business. For example, your information may be shared with outside vendors to send you emails and messages or push notifications to your devices in relation to our Services, to help us analyze and improve the use of our Services, to process and collect payments. We also may use vendors for other projects, such as conducting surveys or organizing sweepstakes for us.</p>\r\n<p class=\"MsoNormal\">With Partner Restaurants/Merchant: While you place a request to order food through the Wah Meal Platform, your information is provided to us and to the restaurants/merchants with whom you may choose to order. In order to facilitate your online food order processing, we provide your information to that restaurant/merchant in a similar manner as if you had made a food order directly with the restaurant. If you provide a mobile phone number, Wah Meal may send you text messages regarding the order&rsquo;s delivery status.</p>\r\n<p class=\"MsoNormal\">With Academic Partners: We may share your information with our academic partners for the purpose of carrying out academic research.</p>\r\n<p class=\"MsoNormal\">With Other Users: If you are a delivery partner, we may share your name, phone number and/or profile picture (if applicable), tracking details with other users to provide them the Services.</p>\r\n<p class=\"MsoNormal\">For Crime Prevention or Investigation: We may share this information with governmental agencies or other companies assisting us, when we are:</p>\r\n<p class=\"MsoNormal\">Obligated under the applicable laws or in good faith to respond to court orders and processes; or</p>\r\n<p class=\"MsoNormal\">Detecting and preventing against actual or potential occurrence of identity theft, fraud, abuse of Services and other illegal acts;</p>\r\n<p class=\"MsoNormal\">Responding to claims that an advertisement, posting or other content violates the intellectual property rights of a third party;</p>\r\n<p class=\"MsoNormal\">Under a duty to disclose or share your personal data in order to enforce our Terms of Use and other agreements, policies or to protect the rights, property, or safety of the Company, our customers, or others, or in the event of a claim or dispute relating to your use of our Services. This includes exchanging information with other companies and organisations for the purposes of fraud detection and credit risk reduction.</p>\r\n<p class=\"MsoNormal\">For Internal Use: We may share your information with any present or future member of our &ldquo;Group&rdquo; (as defined below)or affiliates for our internal business purposes The term &ldquo;Group&rdquo; means, with respect to any person, any entity that is controlled by such person, or any entity that controls such person, or any entity that is under common control with such person, whether directly or indirectly, or, in the case of a natural person, any Relative (as such term is defined in the Companies Act, 1956 and Companies Act, 2013 to the extent applicable) of such person.</p>\r\n<p class=\"MsoNormal\">With Advertisers and advertising networks: We may work with third parties such as network advertisers to serve advertisements on the Wah Meal Platform and on third-party websites or other media (e.g., social networking platforms). These third parties may use cookies, JavaScript, web beacons (including clear GIFs), Flash LSOs and other tracking technologies to measure the effectiveness of their ads and to personalize advertising content to you.</p>\r\n<p class=\"MsoNormal\">While you cannot opt out of advertising on the Wah Meal Platform, you may opt out of much interest-based advertising on third party sites and through third party ad networks (including DoubleClick Ad Exchange, Facebook Audience Network and Google AdSense). For more information, visit www.aboutads.info/choices. Opting out means that you will no longer receive personalized ads by third parties ad networks from which you have opted out, which is based on your browsing information across multiple sites and online services. If you delete cookies or change devices, your opt out may no longer be effective.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">To fulfill the purpose for which you provide it.</p>\r\n<p class=\"MsoNormal\">We may share your information other than as described in this Policy if we notify you and you consent to the sharing.</p>\r\n<p class=\"MsoNormal\"><span style=\"mso-spacerun: yes;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">DATA SECURITY PRECAUTIONS</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">We have in place appropriate technical and security measures to secure the information collected by us.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">We use vault and tokenization services from third party service providers to protect the sensitive personal information provided by you. The third-party service providers with respect to our vault and tokenization services and our payment gateway and payment processing are compliant with the payment card industry standard (generally referred to as PCI compliant service providers). You are advised not to send your full credit/debit card details through unencrypted electronic platforms. Where we have given you (or where you have chosen) a username and password which enables you to access certain parts of the Wah Meal Platform, you are responsible for keeping these details confidential. We ask you not to share your password with anyone.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">Please we aware that the transmission of information via the internet is not completely secure. Although we will do our best to protect your personal data, we cannot guarantee the security of your data transmitted through the Wah Meal Platform. Once we have received your information, we will use strict physical, electronic, and procedural safeguards to try to prevent unauthorised access.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">OPT-OUT</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">When you sign up for an account, you are opting in to receive emails from Wah Meal. You can log in to manage your email preferences [here] or you can follow the &ldquo;unsubscribe&rdquo; instructions in commercial email messages, but note that you cannot opt out of receiving certain administrative notices, service notices, or legal notices from Wah Meal.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">If you wish to withdraw your consent for the use and disclosure of your personal information in the manner provided in this Policy or you want your data to be deleted, please write to us at support@WahMeal.in. Please note that we may take time to process such requests, and your request shall take effect no later than 5 (Five) business days from the receipt of such request, after which we will not use your personal data for any processing unless required by us to comply with our legal obligations. We may not be able offer you any or all Services upon such withdrawal of your consent.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">GRIEVANCE OFFICER AND Wah Meal PLATFORM SECURITY</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">If you have any queries relating to the processing or usage of information provided by you in connection with this Policy, please email us at support@WahMeal.in or write to our Grievance Officer at the following address:</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">Wah Meal Grievance Officer</p>\r\n<p class=\"MsoNormal\">grievance@wahmeal.in</p>\r\n<p class=\"MsoNormal\">If you come across any abuse or violation of the Policy, please report to grievances@WahMeal.in</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>'),
